import CentralBlock from './components/CentalBlock';
import Header from './components/header';
import Table from './components/table';

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <Table />
        <CentralBlock predictedIncome={120000}
        lowerBound={105000}
        upperBound={135000}
        confidence={0.72}
        featureImportances={[
          { name: "Стаж работы", value: 18000 },
          { name: "Оборот по карте", value: 12000 },
          { name: "Кредитная нагрузка", value: -8000 },
          { name: "Количество просрочек", value: -5000 },
        ]}
        textExplanation={
          "Доход клиента выше среднего благодаря длительному стажу работы " +
          "и высокому обороту по счетам. Модель снижает прогноз из-за " +
          "кредитной нагрузки и истории просрочек."
        }/>
      </main>
    </div>
  );
}

export default App;
